"original": |2-
     The first byte (00) of the bit string indicates that there is no
     "number of unused bits", and the second byte (04) indicates
     uncompressed form ([RFC5480]).  Those two octets are followed by the
     values of X and Y.
"fixed": |-
  The first byte (00) of the bit string indicates that there is no "number of unused bits", and the second byte (04) indicates uncompressed form ([RFC5480]).  Those two octets are followed by the values of X and Y.
"ko": |-
  비트열의 첫 번째 바이트(00)는 "사용되지 않은 비트 수"가 없음을 나타내고 두 번째 바이트(04)는 압축되지 않은 형식([RFC5480])을 나타냅니다.  이 두 옥텟 뒤에는 X와 Y 값이 옵니다.
